import React from 'react';
import styled from 'styled-components';
import {Vec2, CELL_SIZE} from '../utility';

type CellProps = {
    fill: boolean;
    position: Vec2;
    color: string;
    // className?: string;
};
//dodalem jakies prop color i dlatego sie nie kompiluje

// const Wrapper = styled.div<CellProps>`
//     border: 2px solid red;
//     color: wheat;
// `;

const Cell: React.FC<CellProps> = (props) => {
    // return <Wrapper fill={props.fill} className={props.className} />;
    //style = {};
    if (props.fill) {
        return (
            <div
                style={{
                    backgroundColor: 'black',
                    border: '2px solid limegreen',
                    width: CELL_SIZE - 4 + 'px',
                    height: CELL_SIZE - 4 + 'px'
                }}>
                {/*{props.position.row}, {props.position.col}*/}
            </div>
        );
    } else {
        return (
            <div
                style={{
                    backgroundColor: 'black',
                    width: CELL_SIZE + 'px',
                    height: CELL_SIZE + 'px'
                }}>
                {/*{props.position.row}, {props.position.col}*/}
            </div>
        );
    }
};

export default Cell;
